import './styles/ice-cream.scss';


import Header from './structure/Header';
import Footer from './structure/Footer';
import Menu from './ice-cream/Menu';


import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';



const App = () => {
  return (
    <Router>   
        <Header />
        <route path="/"></route>
        <Menu />
        <Footer/>
   </Router> 
  );
};

export default App;
